47304<\\/font><\\/font><\\/strong><br><br><font color=\\\"#fdf8f8\\\"><strong><font size=\\\"4\\\">Buying &amp; Selling By Appointments Only - Please Call In Advance<br><\\/font><\\/strong><\\/font><br><font size=\\\"4\\\" style=\\\"color: rgb(253, 248, 248);\\\"><strong>Monday \\/ Tuesday \\/ Wednesday \\/ Thursday \\/ Friday \\/ Saturday<\\/strong><\\/font><br><strong style=\\\"color: rgb(253, 248, 248);\\\"><font size=\\\"4\\\">10:00 am to 5:00 pm<\\/font><em style=\\\"position: relative;\\\">&nbsp;<\\/em><\\/strong><br><br><strong><font color=\\\"#ffffff\\\"><font size=\\\"4\\\"><\\/font><\\/font><\\/strong><\\/div><div class=\\\"paragraph\\\" style=\\\"overflow-wrap: break-word; margin: 0px 0px 10px; padding: 0px; font-weight: 400; white-space: normal; background-color: rgb(44, 90, 151); line-height: 22px !important; font-family: Arial !important; font-size: 15px !important; color: rgb(81, 81, 81) !important;\\\"><strong><font size=\\\"3\\\" color=\\\"#fdfafa\\\">With nearly 20 years of experience in the hobby, Collector\'s Exchange is one of the largest and most trusted buyers of sports cards &amp; collectibles in Indiana. Though we specialize in purchasing sports related items, we also buy coins, &amp; vintage collectibles. With our extensive knowledge base and understanding of current market values, we\\u2019re able to accurately appraise the value of your collection in a timely manner. Our large network of customers and online retailers across the country allow us to pay very strongly for your collectibles. We\\u2019re always prepared to make competitive offers, regardless if your collection is worth $200 or $200,000, financing will never be a problem.<br>&nbsp;<br>Our brick and mortar office is located inside the Williamsburg Center on North Oakwood Ave. Muncie, Indiana. The office location is not a retail store, rather a \\u201cbuying hub\\u201d for collectors and those looking to sell collectibles.&nbsp;Because we resell our inventory to clients directly and through a variety of eCommerce (online) venues, our inventory is not offered to the local public unless by appointment.&nbsp; If you\\u2019re wanting to sell but can\'t make it to our office with your collection, we can travel to you at no cost.&nbsp; If a deal is reached, we\\u2019ll handle all the logistics and expenses of getting your items back to our facility.<br>&nbsp;<br><\\/font><\\/strong><\\/div><strong style=\\\"color: rgb(81, 81, 81); font-family: Arial; font-size: 15px; white-space: normal;\\\"><font size=\\\"3\\\" color=\\\"#fdfafa\\\">If we don\'t buy your collection, we\'d be happy to discuss our brokering options.&nbsp; Over the years, we\\u2019ve developed relationships with some of the largest dealers, auction houses and collectors in the nation.&nbsp; As a broker, we\'ll work as a liaison between you and our resources to maximize the value of your collection. If you are a motivated seller, give us a call today to set up an appointment, we\\u2019re looking forward to hearing from you.<\\/font><\\/strong>\",\"align\":\"center\",\"title_color\":\"#FFFFFF\",\"typography_typography\":\"custom\",\"typography_font_family\":\"Roboto\",\"typography_font_weight\":\"600\"},\"elements\":[],\"widgetType\":\"heading\"}],\"isInner\":false}],\"isInner\":false}]'),
