(219, 1, '2022-06-29 10:32:26', '2022-06-29 10:32:26', '<style>/*! elementor - v3.6.6 - 08-06-2022 */\n.elementor-widget-image{text-align:center}.elementor-widget-image a{display:inline-block}.elementor-widget-image a img[src$=\".svg\"]{width:48px}.elementor-widget-image img{vertical-align:middle;display:inline-block}</style>												<img width=\"960\" height=\"135\" src=\"http://localhost/workshop200/wp-content/uploads/2022/06/untitled-1_3.jpg\" alt=\"Collectors\" loading=\"lazy\" srcset=\"http://localhost/workshop200/wp-content/uploads/2022/06/untitled-1_3.jpg 960w, http://localhost/workshop200/wp-content/uploads/2022/06/untitled-1_3-300x42.jpg 300w, http://localhost/workshop200/wp-content/uploads/2022/06/untitled-1_3-768x108.jpg 768w\" sizes=\"(max-width: 960px) 100vw, 960px\" />															\n			<style>/*! elementor - v3.6.6 - 08-06-2022 */\n.elementor-widget-image-carousel .swiper-container{position:static}.elementor-widget-image-carousel .swiper-container .swiper-slide figure{line-height:inherit}.elementor-widget-image-carousel .swiper-slide{text-align:center}.elementor-image-carousel-wrapper:not(.swiper-container-initialized) .swiper-slide{max-width:calc(100% / var(--e-image-carousel-slides-to-show, 3))}</style>		\n								<figure><img src=\"http://localhost/workshop200/wp-content/uploads/2022/06/1.jpg\" alt=\"1\" /></figure><figure><img src=\"http://localhost/workshop200/wp-content/uploads/2022/06/2-1024x431.jpg\" alt=\"2\" /></figure><figure><img src=\"http://localhost/workshop200/wp-content/uploads/2022/06/3-1024x490.jpg\" alt=\"3\" /></figure><figure><img src=\"http://localhost/workshop200/wp-content/uploads/2022/06/4-1024x475.jpg\" alt=\"4\" /></figure><figure><img src=\"http://localhost/workshop200/wp-content/uploads/2022/06/5-1024x471.jpg\" alt=\"5\" /></figure><figure><img src=\"http://localhost/workshop200/wp-content/uploads/2022/06/6-1024x490.jpg\" alt=\"6\" /></figure><figure><img src=\"http://localhost/workshop200/wp-content/uploads/2022/06/7-1024x377.jpg\" alt=\"7\" /></figure><figure><img src=\"http://localhost/workshop200/wp-content/uploads/2022/06/8-1024x416.jpg\" alt=\"8\" /></figure><figure><img src=\"http://localhost/workshop200/wp-content/uploads/2022/06/9-1024x334.jpg\" alt=\"9\" /></figure><figure><img src=\"http://localhost/workshop200/wp-content/uploads/2022/06/10-1024x386.jpg\" alt=\"10\" /></figure><figure><img src=\"http://localhost/workshop200/wp-content/uploads/2022/06/11-1024x379.jpg\" alt=\"11\" /></figure><figure><img src=\"http://localhost/workshop200/wp-content/uploads/2022/06/12-1024x448.jpg\" alt=\"12\" /></figure>			\n															<img width=\"960\" height=\"131\" src=\"http://localhost/workshop200/wp-content/uploads/2022/07/slide2_2.jpg\" alt=\"buying\" loading=\"lazy\" srcset=\"http://localhost/workshop200/wp-content/uploads/2022/07/slide2_2.jpg 960w, http://localhost/workshop200/wp-content/uploads/2022/07/slide2_2-300x41.jpg 300w, http://localhost/workshop200/wp-content/uploads/2022/07/slide2_2-768x105.jpg 768w\" sizes=\"(max-width: 960px) 100vw, 960px\" />															\n			<style>/*! elementor - v3.6.6 - 08-06-2022 */\n.elementor-heading-title{padding:0;margin:0;line-height:1}.elementor-widget-heading .elementor-heading-title[class*=elementor-size-]>a{color:inherit;font-size:inherit;line-height:inherit}.elementor-widget-heading .elementor-heading-title.elementor-size-small{font-size:15px}.elementor-widget-heading .elementor-heading-title.elementor-size-medium{font-size:19px}.elementor-widget-heading .elementor-heading-title.elementor-size-large{font-size:29px}.elementor-widget-heading .elementor-heading-title.elementor-size-xl{font-size:39px}.elementor-widget-heading .elementor-heading-title.elementor-size-xxl{font-size:59px}</style><h2><strong><font color=\"#ffffff\"><font size=\"4\">Dustin Phelps<br>Owner &amp; Director of Acquisitions<br>1-765-729-5507<br><br>Williamsburg Center North Oakwood Ave. Muncie, Indiana 47304</font></font></strong><br><br><font color=\"#fdf8f8\"><strong><font size=\"4\">Buying &amp; Selling By Appointments Only - Please Call In Advance<br></font></strong></font><br><font size=\"4\" style=\"color: rgb(253, 248, 248);\"><strong>Monday / Tuesday / Wednesday / Thursday / Friday / Saturday</strong></font><br><strong style=\"color: rgb(253, 248, 248);\"><font size=\"4\">10:00 am to 5:00 pm</font><em style=\"position: relative;\">&nbsp;</em></strong><br><br><strong><font color=\"#ffffff\"><font size=\"4\"></font></font></strong><strong><font size=\"3\" color=\"#fdfafa\">With nearly 20 years of experience in the hobby, Collector\'s Exchange is one of the largest and most trusted buyers of sports cards &amp; collectibles in Indiana. Though we specialize in purchasing sports related items, we also buy coins, &amp; vintage collectibles. With our extensive knowledge base and understanding of current market values, we’re able to accurately appraise the value of your collection in a timely manner. Our large network of customers and online retailers across the country allow us to pay very strongly for your collectibles. We’re always prepared to make competitive offers, regardless if your collection is worth $200 or $200,000, financing will never be a problem.<br>&nbsp;<br>Our brick and mortar office is located inside the Williamsburg Center on North Oakwood Ave. Muncie, Indiana. The office location is not a retail store, rather a “buying hub” for collectors and those looking to sell collectibles.&nbsp;Because we resell our inventory to clients directly and through a variety of eCommerce (online) venues, our inventory is not offered to the local public unless by appointment.&nbsp; If you’re wanting to sell but can\'t make it to our office with your collection, we can travel to you at no cost.&nbsp; If a deal is reached, we’ll handle all the logistics and expenses of getting your items back to our facility.<br>&nbsp;<br></font></strong><strong style=\"color: rgb(81, 81, 81); font-family: Arial; font-size: 15px; white-space: normal;\"><font size=\"3\" color=\"#fdfafa\">If we don\'t buy your collection, we\'d be happy to discuss our brokering options.&nbsp; Over the years, we’ve developed relationships with some of the largest dealers, auction houses and collectors in the nation.&nbsp; As a broker, we\'ll work as a liaison between you and our resources to maximize the value of your collection. If you are a motivated seller, give us a call today to set up an appointment, we’re looking forward to hearing from you.</font></strong></h2>', 'Home', '', 'publish', 'closed', 'closed', '', 'elementor-219', '', '', '2022-07-01 05:55:47', '2022-07-01 05:55:47', '', 0, 'http://localhost/workshop200/?page_id=219', 0, 'page', '', 0),
